Superman v2 #217, 218, 220, 221, 222, 223, 224, 225, 226:
Publisher:  DC Comics
Publication Date:  July 2005 - April 2006

Superman v2 #217
After the events of the past months, Superman has left Metropolis and created a new Fortress of Solitude in the Amazon jungle. Lois and Jimmy come to find him, only to meet some unexpected resistance.

Superman v2 #218
Blackrock, a new villain, makes his presence known when his powers go out of control! Can Superman take him out without becoming a bigger menace to the citizens of Metropolis?

Superman v2 #220
Superman and Superboy find their way to the ruins of the old Fortress of Solitude in the Arctic with John Henry Irons to check on the missing Eradicator. Unfortunately, the Eradicator still believes Krypton's sons are rogues, and he's prepared to take care of that problem!

Superman v2 #221
Superman's being pulled in all directions in an issue that ties into VILLAINS UNITED! Omac is running loose. Villains are united. Magic is everywhere. Naturally, it's a perfect time for Bizarro to show up!

Superman v2 #222
The world is going to hell as the CRISIS begins--this is too big a job even for Superman! But what has changed that scares those closest to the Man of Steel?

Superman v2 #223
An INFINITE CRISIS tie-in! Supergirl breaks the news to Kal that she's heading off into space with Donna Troy. Will their final farewell be cut short by a new, more deadly Blackrock?

Superman v2 #224
An INFINITE CRISIS tie-in! Mortal enemies find themselves on common ground in the two unlikeliest of places! In the Amazon the new and more lethal Blackrock continues her assault on Superman, while miles away in the Arctic, Lex Luthor battles for his life against his deadliest adversary.

Superman v2 #225
An INFINITE CRISIS tie-in! With the full weight of the Crisis events on his shoulders, the Man of Steel undergoes a drastic change as he wages an all-out war in Metropolis!

Superman (1987-2006) #226
&quot;This is Your Life, Superman&quot; part 1! Witness the arrival of Kal-L, the Last Son of Krypton--and learn how he grew up to be the greatest hero of Earth-2. Continued in Action Comics v1 #836.

